import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import ProductManagement from './Pages/ProductManagement'; // Import the ProductManagement component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/Pages/ProductManagement" element={<ProductManagement />} />
      </Routes>
    </Router>
  );
}

export default App;
